import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate, Link } from 'react-router-dom';

const Register = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    phone: '',
    department: '',
    year: ''
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const { register } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage('');

    const result = await register(formData);
    
    if (result.success) {
      setMessage('✅ Registration successful! Redirecting...');
      setTimeout(() => {
        navigate('/', { replace: true });
      }, 1000);
    } else {
      setMessage('❌ ' + result.message);
    }
    setLoading(false);
  };

  return (
    <div style={styles.container}>
      {/* Animated background shapes */}
      <div style={styles.shape1}></div>
      <div style={styles.shape2}></div>
      <div style={styles.shape3}></div>
      
      <div style={styles.card}>
        <div style={styles.header}>
          <div style={styles.badge}>EventHub</div>
          <h2 style={styles.title}>Create Your Account</h2>
          <p style={styles.subtitle}>Join thousands of event enthusiasts</p>
        </div>
        
        {message && (
          <div style={{
            padding: '14px 20px',
            borderRadius: '12px',
            marginBottom: '24px',
            background: message.includes('✅') ? 'linear-gradient(135deg, #10b981, #059669)' : 'linear-gradient(135deg, #ef4444, #dc2626)',
            color: '#fff',
            fontWeight: '600',
            boxShadow: '0 8px 20px rgba(0,0,0,0.15)',
            border: 'none'
          }}>
            {message}
          </div>
        )}

        <form onSubmit={handleRegister} style={styles.form}>
          <div style={styles.row}>
            <div style={styles.inputWrapper}>
              <label style={styles.label}>Full Name</label>
              <input
                style={styles.input}
                type="text"
                name="name"
                placeholder="John Doe"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>
          </div>

          <div style={styles.row}>
            <div style={styles.inputWrapper}>
              <label style={styles.label}>Email Address</label>
              <input
                style={styles.input}
                type="email"
                name="email"
                placeholder="john@example.com"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </div>
          </div>

          <div style={styles.row}>
            <div style={styles.inputWrapper}>
              <label style={styles.label}>Password</label>
              <input
                style={styles.input}
                type="password"
                name="password"
                placeholder="Minimum 6 characters"
                value={formData.password}
                onChange={handleChange}
                required
              />
            </div>
          </div>

          <div style={styles.row}>
            <div style={styles.inputWrapper}>
              <label style={styles.label}>Phone Number</label>
              <input
                style={styles.input}
                type="tel"
                name="phone"
                placeholder="Optional"
                value={formData.phone}
                onChange={handleChange}
              />
            </div>
          </div>

          <div style={styles.gridRow}>
            <div style={styles.inputWrapper}>
              <label style={styles.label}>Department</label>
              <input
                style={styles.input}
                type="text"
                name="department"
                placeholder="CS, IT, etc."
                value={formData.department}
                onChange={handleChange}
              />
            </div>

            <div style={styles.inputWrapper}>
              <label style={styles.label}>Year</label>
              <select
                style={styles.input}
                name="year"
                value={formData.year}
                onChange={handleChange}
              >
                <option value="">Select</option>
                <option value="1st Year">1st Year</option>
                <option value="2nd Year">2nd Year</option>
                <option value="3rd Year">3rd Year</option>
                <option value="4th Year">4th Year</option>
              </select>
            </div>
          </div>

          <button
            type="submit"
            style={styles.button}
            disabled={loading}
            onMouseOver={(e) => !loading && (e.target.style.transform = 'translateY(-2px)', e.target.style.boxShadow = '0 15px 40px rgba(56,189,248,0.4)')}
            onMouseOut={(e) => (e.target.style.transform = 'translateY(0)', e.target.style.boxShadow = '0 10px 30px rgba(56,189,248,0.3)')}
          >
            {loading ? 'Creating Account...' : 'Create Account →'}
          </button>
        </form>

        <div style={styles.footer}>
          <span style={styles.footerText}>Already have an account?</span>
          <Link to="/login" style={styles.footerLink}>Sign in</Link>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    padding: '20px',
    background: 'linear-gradient(135deg, #0f172a 0%, #1e293b 100%)',
    position: 'relative',
    overflow: 'hidden'
  },
  shape1: {
    position: 'absolute',
    width: '500px',
    height: '500px',
    borderRadius: '50%',
    background: 'radial-gradient(circle, rgba(56,189,248,0.15), transparent)',
    top: '-10%',
    right: '-5%',
    animation: 'float 6s ease-in-out infinite'
  },
  shape2: {
    position: 'absolute',
    width: '400px',
    height: '400px',
    borderRadius: '50%',
    background: 'radial-gradient(circle, rgba(124,58,237,0.12), transparent)',
    bottom: '-5%',
    left: '-5%',
    animation: 'float 8s ease-in-out infinite'
  },
  shape3: {
    position: 'absolute',
    width: '300px',
    height: '300px',
    borderRadius: '50%',
    background: 'radial-gradient(circle, rgba(56,189,248,0.1), transparent)',
    top: '40%',
    left: '50%',
    animation: 'float 7s ease-in-out infinite'
  },
  card: {
    background: 'rgba(255,255,255,0.97)',
    padding: '50px 45px',
    borderRadius: '24px',
    boxShadow: '0 40px 100px rgba(0,0,0,0.4), 0 0 0 1px rgba(255,255,255,0.1)',
    maxWidth: '500px',
    width: '100%',
    backdropFilter: 'blur(20px)',
    position: 'relative',
    zIndex: 1,
    border: '1px solid rgba(255,255,255,0.2)'
  },
  header: {
    textAlign: 'center',
    marginBottom: '40px'
  },
  badge: {
    display: 'inline-block',
    padding: '8px 20px',
    background: 'linear-gradient(135deg, #38bdf8, #7c3aed)',
    color: '#fff',
    borderRadius: '20px',
    fontSize: '13px',
    fontWeight: '700',
    letterSpacing: '0.5px',
    marginBottom: '20px',
    textTransform: 'uppercase',
    boxShadow: '0 4px 15px rgba(56,189,248,0.3)'
  },
